import React, { useEffect, useState } from 'react';
import { Card, Typography, Box, LinearProgress, Grid, Chip } from '@mui/material';
import { subscribeToTelemetry } from '../api/socket';

const InfoCard = ({ title, value, unit, color }) => (
  <Card sx={{ p: 2, mb: 2, backgroundColor: '#1e293b', color: 'white' }}>
    <Typography variant="subtitle2" color="gray">
      {title}
    </Typography>
    <Typography variant="h5" sx={{ color: color || '#0ff' }}>
      {value} {unit}
    </Typography>
  </Card>
);

const TelemetryPanel = () => {
  const [data, setData] = useState({});

  useEffect(() => {
    const unsubscribe = subscribeToTelemetry((incoming) => {
      console.log('ðŸ“¡ Received telemetry:', incoming);  // Add this!
      setData(incoming);
    });
    return () => unsubscribe();
  }, []);
  

  return (
    <Box>
      <Typography variant="h6" sx={{ color: '#fff', mb: 2 }}>
        ðŸ”§ Telemetry Panel
      </Typography>

      <Grid container spacing={2}>
        <Grid item xs={6}>
          <InfoCard title="Battery" value={data.battery} unit="V" color={data.battery < 8 ? 'red' : '#0ff'} />
          <InfoCard title="Altitude" value={data.altitude} unit="m" />
          <InfoCard title="Temperature" value={data.temperature} unit="Â°C" color={data.temperature > 60 ? 'orange' : '#0ff'} />
        </Grid>

        <Grid item xs={6}>
          <InfoCard title="Roll" value={data.roll} unit="Â°" />
          <InfoCard title="Pitch" value={data.pitch} unit="Â°" />
          <InfoCard title="Yaw" value={data.yaw} unit="Â°" />
        </Grid>
      </Grid>

      <Box mt={2}>
        <Typography variant="body2" color="gray">GPS:</Typography>
        <Typography variant="body1" color="#fff">
          {data.gps ? `${data.gps.lat}, ${data.gps.lon}` : 'â€”'}
        </Typography>
      </Box>

      <Box mt={2}>
        <Typography variant="body2" color="gray">Connection:</Typography>
        <Chip label={data.connection || 'â€”'} color={
          data.connection === 'Excellent' ? 'success' :
          data.connection === 'Good' ? 'primary' :
          data.connection === 'Poor' ? 'warning' : 'error'
        } />
      </Box>
    </Box>
  );
};

export default TelemetryPanel;
